    const game = useSelector(store => store.games.game)
    console.log(game)

    return (
        <div className="game-wrapper"> 
            <div>{game.directions}</div>
            <div>{game.question}</div>
            {game.hint}
            <div className="answer-box">

             </div>
        </div>


    )
}
